literals:
position: fixed;
    top: 0 ; 
    left: 0 ;
    background-color: #000; 
    width: 250px;
    height: 100vh;

width: 100%;
    margin-top: 20px;
    display: flex;
    justify-content: space-around;
    align-items: center;

width: 50px;
    height: 50px;
    border-radius: 50%;
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: transparent;
    color:white ; 
    font-size: 30px;
    animation-name: ${size};
    animation-duration: 1.5s;
    animation-iteration-count: infinite;

list-style: none;
    color : white ; 
    margin: 20px ;  
    font-size: 23px;

margin-top: 10px;
    text-transform: capitalize;
    cursor: pointer;
    padding:20px ;

position: absolute;
    top:30% ; 
    left:45% ; 
    width :500px ;
    text-align: center;

width: 300px;
    height: 300px;
    animation-name: ${rotation};
    animation-duration: 5s;
    animation-iteration-count: infinite;

font-size: 30px;
    background-color: black;
    color:white; 
    position: absolute;
    top: 10px ; 
    right: 10px ;
